import React, { Component } from 'react';
import biologia from '../../images/lunchrooms/biologia.png';

class LunchroomContainer extends Component {
  render() {
    return (
      <div className="LunchroomContainer">
        <div className="col-md-3">
          <div className="thumbnail">
            <img src={ biologia } className="small" alt="biologia"/>
          </div>
        </div>
      </div>
    );
  }
}

export default LunchroomContainer;
